import Link from "next/link";
import styles from "./Nav.modules.scss";

const BottomBar = (props) => {
  const {current} = props;
  return(
  <div className= "bottom" >
    <div className="bottom-button-wrapper">
    <button id="book" className={`bottom-bar-button ${current==''? 'current': ''}`}><a href='http://www.secure-booker.com/angelamichael/MakeAppointment/Search.aspx'>Book</a></button>
    <button id="home" className={`bottom-bar-button ${current=='home'? 'current': ''}`}><Link href='/'>Home</Link></button>
    <button id="blog" className={`bottom-bar-button ${current=='blog'? 'current': ''}`}><Link href='/posts'>Blog</Link></button>
    </div>
  </div>
  )
};

export default BottomBar;

